import React, { Fragment } from "react";

import { Card, Avatar, Button, Input } from "antd";

const { Meta } = Card;

export default function Edit(props) {
  //                     title: a.table_number,
  //                     url: a.url,
  //                     name: a.name,
  //                     order: a.order
  return (
    <Fragment>
      <Card
        title={props.location.state.title}
        cover={<img alt="" src={props.location.state.url} />}
        style={{ width: "400px" }}
      >
        <Meta
          title={<Input value={props.location.state.name} />}
          description={<Input value={props.location.state.order} />}
        />
      </Card>
      <Button
        style={{ width: "150px", margin: "1em 0" }}
        onClick={() => props.history.push("/order")}
      >
        Back to Order
      </Button>
    </Fragment>
  );
}
